void PORTD_IRQHandler(void) 															//PORTC_PORTD Interrupt service routine ISR
{	
		tmp=time;
		time=0;
		if(tmp<500)
		{
		time_globe=tmp;

		
					for(i=0;i<128; i++)            				 // columns
				{
						for(j=0;j<8; j++)           		    // rows groups
						{	
								setAnodes(syl + 4*(i*8+j));
								setCathodes(j);          		    
								for(k=0;k<(time_globe); k++);  
						}	
				}
						clear_cathodes();
				time_globe=0;
			}

	PORTD->PCR[OPTO_PIN] |= PORT_PCR_ISF_MASK;										//set the flag
}

